import React, { Component } from 'react'

import TopNav from "../TopNav/TopNav"
import FooterBar from "../FooterBar/FooterBar"
import Body from "../Body/Body"

export default class Home extends Component {
    render() {
        return (
            <div clas>
                <TopNav />
                <Body />
                <FooterBar />
            </div>
        )
    }
}
